import React, {Fragment} from 'react';

function Formulario() {
    return(
        <Fragment>
            <h2>Crear Cita</h2>
            
            <form>
                <label>Nombre MAscota</label>
            </form>
        </Fragment>
    );
}

export default Formulario;
